})
export class CheckboxComponent extends CommonFieldComponent {}

import { ChangeDetectionStrategy, Component } from '@angular/core';
import { CommonFieldComponent, CommonFieldModule } from '../common-field';
import {
  MatCheckboxChange,
  MatCheckboxModule,
} from '@angular/material/checkbox';

@Component({
  selector: 'techbir-checkbox-group',
  standalone: true,
  imports: [CommonFieldModule, MatCheckboxModule],
  templateUrl: './checkbox-group.component.html',
  styles: [],
})
export class CheckboxGroupComponent extends CommonFieldComponent {
  __intermediate: any = {};
  __parentValues: any = {};

  setParentValue(event: MatCheckboxChange, parentId: any) {
    const found = this.options?.find((e) => e.id === parentId);

    if (found) {
      this.__parentValues[parentId] = event.checked;

      if (found.children) {
        found.children.forEach((e) => (e.value = event.checked));
      }
    }
    this.__intermediate[parentId] = false;
    this.setControlValue();
  }

  setChildValue(event: MatCheckboxChange, parentId: any, childId: any) {
    const found = this.options?.find((e) => e.id === parentId);

    if (found) {
      const foundChild = found.children?.find((e) => e.id === childId);

      if (foundChild) {
        foundChild.value = event.checked;
      }

      const isAllChecked = found.children
        ?.map((v) => v.value)
        .reduce((p, c) => p && c);

      const isAllUnChecked = found.children
        ?.map((e) => e.value)
        .reduce((p, c) => !p && !c);

      if (isAllChecked) {
        this.__parentValues[parentId] = true;
        this.__intermediate[parentId] = false;
      } else if (isAllUnChecked) {
        this.__intermediate[parentId] = false;
        this.__parentValues[parentId] = false;
      } else {
        this.__intermediate[parentId] = true;
      }
    }
    this.setControlValue();
  }

  setControlValue() {
    const currentValue = this.options
      ?.map((e) => ({
        [e.id]:
          e.children
            ?.map((k) => ({ [k.id]: k.value }))
            .reduce((p, c) => ({ ...p, ...c })) || this.__parentValues[e.id],
      }))
      .reduce((p, c) => ({ ...p, ...c }));

    this.control?.setValue(currentValue);
    return currentValue;
  }
}

import {
  Component,
  Inject,
  Input,
  NgModule,
  OnInit,
  Optional,
} from '@angular/core';
import {
  AbstractControl,
  FormGroup,
  FormsModule,
  ReactiveFormsModule,
} from '@angular/forms';
import {
  FORM_FIELD_APPEARANCE_TOKEN,
  InputOptions,
  ResourceService,
} from '../../api';
import { MatFormField, MatFormFieldModule } from '@angular/material/form-field';
import { MatInputModule } from '@angular/material/input';
import { MatIconModule } from '@angular/material/icon';
import { MatButtonModule } from '@angular/material/button';
import { CommonModule } from '@angular/common';
import { Observable, map } from 'rxjs';

const formModules = [
  CommonModule,
  FormsModule,
  ReactiveFormsModule,
  MatInputModule,
  MatFormFieldModule,
  MatIconModule,
  MatButtonModule,
];

@NgModule({
  imports: [...formModules],
  exports: [...formModules],
})
export class CommonFieldModule {}

@Component({ template: '' })
export class CommonFieldComponent implements OnInit {
  /**
   * Property name
   */
  @Input() name!: string;

  /**
   * Property label
   */
  @Input() label = '';

  /**
   * Property icon
   */
  @Input() icon = '';

  /**
   * Options for readio/checkbox-group and select components
   */
  @Input() enums?: string[];

  /**
   * Options for readio/checkbox-group and select components
   */
  @Input() options?: InputOptions[];

  /**
   * FormControl instance
   */
  control!: AbstractControl;

  filteredOptions$?: Observable<any>;

  constructor(
    @Inject(FormGroup) public readonly formGroup: FormGroup,
    @Optional()
    @Inject(FORM_FIELD_APPEARANCE_TOKEN)
    public readonly appearance: MatFormField['appearance']
  ) {
    if (!appearance) this.appearance = 'outline';
    if (!formGroup) throw new Error('FormGroup must be provided!');
  }

  ngOnInit(): void {
    const foundControl = this.formGroup.get(this.name);

    if (!foundControl) {
      throw new Error(`${this.name} control is not found in formGroup!`);
    }

    this.control = foundControl;

    if (this.enums) {
      this.options = this.enums.map((e) => ({ id: e, label: e, value: e }));
    }

    this.filteredOptions$ = this.control.valueChanges.pipe(
      map((value) => {
        return this.options?.filter((e) => {
          return (e.value as string)
            ?.toLowerCase()
            .includes((value as string).toLowerCase() || '');
        });
      })
    );
  }

  getErrors() {
    return Object.values(this.control.errors || {}).join(', ');
  }
}

