          import('./delete/delete.component').then((c) => c.DeleteComponent),
        providers: [provideModuleName('Delete')],
      },
      {
        path: 'config',
        loadComponent: () =>
          import('./config/config.component').then((c) => c.ConfigComponent),
        providers: [provideModuleName('Config')],
      },
    ],
  },
]

